// /* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react'
import { Link } from 'react-router-dom'
import { Container } from 'reactstrap'

const NavBar = () => {
    return (
        <div>
<nav class="navbar navbar-expand-lg navbar-light bg-body-tertiary">
  <div class="container-fluid">
    <button
      data-mdb-collapse-init
      class="navbar-toggler"
      type="button"
      data-mdb-target="#navbarSupportedContent"
      aria-controls="navbarSupportedContent"
      aria-expanded="false"
      aria-label="Toggle navigation"
    >
      <i class="fas fa-bars"></i>
    </button>

    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <a class="navbar-brand mt-2 mt-lg-0" to="#">
        <img
          src="https://mdbcdn.b-cdn.net/img/logo/mdb-transaprent-noshadows.webp"
          height="15"
          alt="MDB Logo"
          loading="lazy"
        />
      </a>
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-item">
          <a class="nav-link" to="#">Dashboard</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" to="#">Team</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" to="#">Projects</a>
        </li>
      </ul>
    </div>

    <div class="d-flex align-items-center">
      <a class="text-reset me-3" to="#">
        <i class="fas fa-shopping-cart"></i>
      </a>

      <div class="dropdown">
        <a
          data-mdb-dropdown-init
          class="text-reset me-3 dropdown-toggle hidden-arrow"
          to="#"
          id="navbarDropdownMenuLink"
          role="button"
          aria-expanded="false"
        >
          <i class="fas fa-bell"></i>
          <span class="badge rounded-pill badge-notification bg-danger">1</span>
        </a>
        <ul
          class="dropdown-menu dropdown-menu-end"
          aria-labelledby="navbarDropdownMenuLink"
        >
          <li>
            <a class="dropdown-item" to="#">Some news</a>
          </li>
          <li>
            <a class="dropdown-item" to="#">Another news</a>
          </li>
          <li>
            <a class="dropdown-item" to="#">Something else here</a>
          </li>
        </ul>
      </div>
      <div class="dropdown">
        <a
          data-mdb-dropdown-init
          class="dropdown-toggle d-flex align-items-center hidden-arrow"
          to="#"
          id="navbarDropdownMenuAvatar"
          role="button"
          aria-expanded="false"
        >
          <img
            src="https://mdbcdn.b-cdn.net/img/new/avatars/2.webp"
            class="rounded-circle"
            height="25"
            alt="Black and White Portrait of a Man"
            loading="lazy"
          />
        </a>
        <ul
          class="dropdown-menu dropdown-menu-end"
          aria-labelledby="navbarDropdownMenuAvatar"
        >
          <li>
            <a class="dropdown-item" to="#">My profile</a>
          </li>
          <li>
            <a class="dropdown-item" to="#">Settings</a>
          </li>
          <li>
            <a class="dropdown-item" to="#">Logout</a>
          </li>
        </ul>
      </div>
    </div>
  </div>
</nav>
            <nav className="navbar navbar-expand-lg">
                <Container>
                    <button
                        data-mdb-collapse-init
                        className="navbar-toggler"
                        type="button"
                        data-mdb-target="#navbarSupportedContent"
                        aria-controls="navbarSupportedContent"
                        aria-expanded="false"
                        aria-label="Toggle navigation"
                    >
                        <i className="fas fa-bars"></i>
                    </button>

                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <Link className="navbar-brand mt-2 mt-lg-0" to="/">
                            <img
                                src="images/my-photo.jpeg"
                                alt="Logo"
                                loading="lazy"
                            />
                        </Link>
                        <ul className="navbar-nav m-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <Link className="nav-link text-light" to="/">home</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link text-light" to="/about">about</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link text-light" to="/portfolio">portfolio</Link>
                            </li>
                        </ul>
                    </div>

                    <div className="d-flex align-items-center">
                        <Link to="/contact"> <button className='btn btn-outline-primary text-light fw-bold btn-lg'>Contact</button></Link>
                    </div>
                </Container>
            </nav>
        </div>
    )
}

export default NavBar





